import React from "react";

export default function NavBarItem() {
  const Icon = fetch("../../../data/navBar.json");
  Icon.then((res) => console.log(res))
    .then((res) => console.log(res.data))
    .catch((err) => console.log(err));
  return <div>Helo</div>;
}
